function Welcome() {
  return (
    <div className="wrapper">
      <h1>Todo-List App</h1>
      <div className="login-container">
        <input placeholder="Account" type='text' />
        <input type="password" placeholder="Password" />
        <button>Sigin</button>
        
      </div>
    </div>
  );
}

export default Welcome;
